function init() {
    // clean the body
    document.body.innerHTML = '';

    let wrapper = document.createElement('div');
    wrapper.classList.add('wrapper');

    let centerWrap = document.createElement('div');
    centerWrap.classList.add('center-wrapper');

    // logo
    // TODO: check how to load local images
    let ytLogo = document.createElement('img');
    ytLogo.src =
        'data:image/png;base64,';
    ytLogo.classList.add('img-yt-logo');

    // input box
    let inpWrap = document.createElement('div');
    inpWrap.classList.add('inp-wrap');
    let inp = document.createElement('input');
    inp.classList.add('inp-box');
    inpWrap.appendChild(inp);

    // search button
    let searchButton = document.createElement('button');
    searchButton.setAttribute('id', 'btnSearch');
    searchButton.classList.add('search-btn');
    searchButton.innerHTML = 'Search YouTube';

    // TODO
    /**
     * - Create top & bottom container
     * - Add click handler to the input box and the button
     * - Navigate to YouTube search page
     * - Add bottom link
     * - Handle bottom link to redirect to clean page
     */

    centerWrap.appendChild(ytLogo);
    centerWrap.appendChild(inpWrap);
    centerWrap.appendChild(searchButton);

    wrapper.appendChild(centerWrap);
    document.body.appendChild(wrapper);
}

init();
